def all_prefixes(string: str) -> List[str]:
    """ Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes('abc')
    ['a', 'ab', 'abc']
    """
    if not string:
        return []

    prefixes = []
    for c in string:
        if c not in prefixes:
            prefixes.append(c)
        else:
            prefixes.append(prefixes[prefixes.index(c)] + c)
    return prefixes

